description:
The film follows &quot;19th Wife&quot; and fundamentalist sect First Church of Latter Day Saints member BeckyLyn, who is accused of killing her husband.

Queenie, another wife in the sect, doesn't believe BeckyLyn is capable of such violence and, desperate to prove her innocence, reaches out to BeckyLyn's excommunicated son Jordan for help in freeing his mother...

